def is_woodall(n):
    """
    Check if the given number is a Woodall number.

    A Woodall number of the form 2^n - 1 is a prime number.
    """
    # Check if n is a power of 2
    if n < 2:
        return False

    # Calculate 2^n - 1
    candidate = 2 ** n - 1

    # Check if the candidate is a prime number
    if candidate > 1:
        for i in range(2, int(candidate ** 0.5) + 1):
            if candidate % i == 0:
                return False
        return True
    else:
        return False

