def pack_consecutive_duplicates(lst):
    result = []
    seen = set()
    for item in lst:
        if item not in seen:
            seen.add(item)
            result.append([item])
        else:
            seen.discard(item)
            if len(result) > 1:
                result[-1].append(item)
    return result

